package problems;

public class SplitTwoStringsToMakePalindrome {

    public static void main(String[] args) {
        String a = "";
        String b = "";

        System.out.println(checkPalindromeFormation(a,b));
    }

    public static boolean checkPalindromeFormation(String a, String b) {

        //length of String
        int n = a.length();

        for(int i = 0; i<n; i++){

            //a-prefix and a-suffix
            String aPref = a.substring(0,i);
            String aSuf = a.substring(i,n);

            //b-prefix and b-suffix
            String bPref = b.substring(0, i);
            String bSuf = b.substring(i,n);

            if(isPalindrome(aPref.concat(bSuf))) return  true;
            if(isPalindrome(bPref.concat(aSuf))) return  true;
        }

        return  false;
    }

    public static boolean isPalindrome(String s){

        //length of String
        int n = s.length();

        int i = 0;
        int j = n-1;

        while(i<j){
            if(s.charAt(i)!=s.charAt(j)) return false;
            i++;
            j--;
        }

        return true;
    }

}
